import React, { useState } from "react";

export default function Loginstatus(props) {
  //function to display 

  const statusStyle = () => {
    console.log(props.status);
    return { color: props.status === "You are logged in"  ? "#008" : "#ff0000" };
  };

  return (
    <div
      className="status"
    >
      <p style={statusStyle()}>{props.status}</p>
    </div>
  );
}
